import React from "react";

function Projects() {
  return (
    <section>
      <h2>Projects</h2>
      <ul>
        <li>A Queue application: Create to avoid standing in the long lines</li>
        <li>Hello HERO: An app designed to treat school children remotely for the therapist & there clients</li>
        <li>eZRx: An web app designed for a south east asian pharmaceutical company to sell there products to the vendors online </li>
      </ul>
    </section>
  );
}

export default Projects;
